import React from "react";
import "./Header.css";
import { NavItem } from "./Navbar";

// let menu = document.querySelector("#menuBar");
// let header = document.querySelector("header");

// menu.onClick = () => {
//   menu.classList.toggle("fa-times");
// };

const Header = () => {
  return (
    <>
      <div id="menuBar" className="fas fa-bars"></div>
      <header>
        <div className="img">
          <img src="images/siam1.jpg" alt="" />
        </div>
        <a href="#" className="logo">
          <span>siam </span>chowdhury
        </a>

        <nav className="navbar">
          <NavItem />
          {/* <a href="#home">home</a>
          <a href="#about">about</a>
          <a href="#service">service</a>
          <a href="#experience">experience</a>
          <a href="#portfolio">portfolio</a>
          <a href="#contact">contact</a> */}
        </nav>

        <div className="follow">
          <a
            href="https://www.facebook.com/syedsiamchowdhury.siam"
            className="fab fa-facebook"
          ></a>
          <a href="#" className="fab fa-twitter"></a>
          <a
            href="https://www.instagram.com/syedsiamchowdhury/"
            className="fab fa-instagram"
          ></a>
          <a
            href="https://www.linkedin.com/in/syed-siam-chowdhury-sm-47300a21a/"
            className="fab fa-linkedin"
          ></a>
        </div>
      </header>
    </>
  );
};

export default Header;
